"부식성 자유지대 맥주\"},\n        [\"선장 라울\"] = {\"사슬탄\", \"부식성 자유지대 맥주\"}\n    }\n}\n\naura_env.LocalBD= {\n    [\"세스랄리스 사원\"] ={\n        [\"모래범벅 독사\"] ={\"먼지 구름\"}, \n        [\"맹독 뱀\"] ={\"먼지 구름\"}, \n        [\"모래받이 명사수\"] ={\"먼지 구름\"}, \n        [\"비늘 크롤러스크 기수\"] ={\"먼지 구름\"}, \n        [\"새끼 크롤러스크\"] ={\"먼지 구름\"}, \n        [\"다 자란 크롤러스크\"] ={\"먼지 구름\"}, \n        [\"가려진 송곳니\"] = {\"먼지 구름\"},\n        [\"비늘 크롤러스크 조련사\"] ={\"먼지 구름\"}, \n        [\"뱀들의 똬리\"] ={\"먼지 구름\"}, \n        [\"메레크타\"] ={\"먼지 구름\"},\n        [\"보주 수호자\"] = {\"되찾은 보주\"},\n    }, \n    [\"아탈다자르\"] = {\n        [\"줄의 방패병\"] = {\"부적의 보루\"}, \n        [\"잔추리 의술사\"] = {\"부적의 보루\"}, \n        [\"그림자칼날 추적자\"] = {\"부적의 보루\"}, \n        [\"되살아난 근위병\"] = {\"부적의 보루\"}\n    },\n    [\"왕노다지 광산!!\"] = {\n        [\"동전 투입식 군중 난타기\"] = {\"돈으로 산 승리\"},\n    },\n    [\"자유지대\"] = {\n        [\"선장 유도라\"] = {\"자신감을 북돋는 자유지대 맥주\",\"활기의 자유지대 맥주\"},\n        [\"선장 졸리\"] = {\"자신감을 북돋는 자유지대 맥주\",\"활기의 자유지대 맥주\"},\n        [\"선장 라울\"] = {\"자신감을 북돋는 자유지대 맥주\",\"활기의 자유지대 맥주\"},\n    }\n}\n\naura_env.LocalA = { \n    [\"썩은굴\"] = {\n        [\"되살아난 수호자\"] = {\"HELPFUL\", \"뼈의 보호막\", 16}\n    },\n    [\"왕들의 안식처\"] = {\n        [\"줄의 수하\"] = {\"HELPFUL\",\"어둠의 결속\", 16},\n        [\"황금 날뱀\"] = {\"HELPFUL\",\"광택\", 17},\n        [\"현자 자나잘\"] = {\"HELPFUL\",\"대지 방벽\", 16}, \n        [\"도살자 쿨라\"] = {\"HELPFUL\",\"대지 방벽\", 16}, \n        [\"정복자 아카알리\"] = {\"HELPFUL\",\"대지 방벽\", 16}\n    }, \n    [\"왕노다지 광산!!\"] = {\n        [\"분노석\"] = {\"HELPFUL\",\"대지 보호막\", 16}\n    },\n    [\"톨 다고르\"] = {\n        [\"항만의 시궁쥐단 바다예언자\"] = {\"HELPFUL\",\"물의 반구\", 17},\n        [\"바다가름 공격병\"] = {\"HELPFUL\",\"물의 반구\", 17},\n        [\"검은이빨 방화범\"] = {\"HELPFUL\",\"물의 반구\", 17},\n        [\"무쇠파도 약탈단\"] = {\"HELPFUL\",\"물의 반구\", 17},\n        [\"실의에 빠진 말썽꾼\"] = {\"HELPFUL\",\"물의 반구\", 17}, \n        [\"바비 하울리스\"] = {\"HARMFUL\",\"칼날 회전막\", 16}\n    },\n    [\"폭풍의 사원\"] = {\n        [\"건져 올린 선원\"] = {\"HELPFUL\",\"되살아난 해골\", 17},\n        [\"속삭임의 볼지스\"] = {\"HELPFUL\",\"가라앉은 도시의 손아귀\", 16}\n    }\n}\n\nWeakAurasSaved['displays'][aura_env.id].uniqueId = \"HobulNAT\"\n\naura_env.Border = function(states)\n    for k, v in pairs(states) do\n        if not v.unit then return\n        else\n            local region = WeakAuras.GetRegion(aura_env.id, k)\n            \n            local top = 3\n            local right = 3\n            local bottom = 3\n            local left = 3\n            \n            local borderCD = true   \n            \n            if not region.Backdrop then\n                local backdrop = {\n                    bgFile = \"Interface\\\\AddOns\\\\WeakAuras\\\\Media\\\\Textures\\\\Square_White.tga\",  \n                    edgeFile = \"\",\n                    tile = false,\n                    tileSize = 32,\n                    edgeSize = 0,\n                    insets = {\n                        left = 0,\n                        right = 0,\n                        top = 0,\n                        bottom = 0\n                    }\n                }\n                local Backdrop = CreateFrame(\"frame\", nil, region);\n                region.Backdrop = Backdrop;\n                region.Backdrop:SetBackdrop(backdrop)\n                region.Backdrop:SetAllPoints(region)\n                region.Backdrop:Show();\n            end\n            \n            if v.type then \n                if v.type == \"Magic\" then\n                    region.Backdrop:SetBackdropColor(0,1,1,1);\n                elseif v.type == \"\" then\n                    region.Backdrop:SetBackdropColor(1,0.65,0,1);\n                elseif v.type == \"Debuff\" or v.type == \"DBuff\" then\n                    region.Backdrop:SetBackdropColor(0,1,0,1);\n                else   \n                    region.Backdrop:SetBackdropColor(1,0,0,1);\n                end\n            else   \n                region.Backdrop:SetBackdropColor(1,0,0,1);\n            end\n            \n            --set the icon inset\n            region.icon:ClearAllPoints()\n            region.icon:SetPoint(\"BOTTOMLEFT\", region, \"BOTTOMLEFT\", left,bottom);\n            region.icon:SetPoint(\"TOPRIGHT\", region, \"TOPRIGHT\", 0-right,0-top);  \n            \n            local regionFrameLevel = region:GetFrameLevel() -- get strata for next bit\n            region.Backdrop:SetFrameLevel(regionFrameLevel-2) -- put the border at the back\n            if borderCD then -- if we want the CD sweep on the border only\n                region.cooldown:SetFrameLevel(regionFrameLevel-1) -- then CD sweep\n                region.cooldown:SetAllPoints(region.Backdrop) -- attach sweep to border\n            else -- if we want the sweep to behave normally, on the icon\n                region.cooldown:SetFrameLevel(regionFrameLevel+1) -- put sweep on top\n                region.cooldown:SetAllPoints(region.icon) -- attach to the icon\n            end\n        end\n    end\nend\n\nfunction aura_env.updateFrames(states)\n    table.wipe(aura_env.auraCount)\n    for k, v in pairs(states) do\n        if not v.unit then return\n        else\n            local region = WeakAuras.GetRegion(aura_env.id, k)\n            local f = C_NamePlate.GetNamePlateForUnit(v.unit)\n            if f and region and region:IsVisible() then\n                aura_env.auraCount[v.unit] = aura_env.auraCount[v.unit] or 0               \n                local order = aura_env.auraCount[v.unit]\n                local xoffset, yoffset = 0, 0\n                local height,width = region:GetHeight() + aura_env.spacing, region:GetWidth() + aura_env.spacing\n                if aura_env.growdirection == \"TOP\" then\n                    yoffset = (order) * height\n                elseif aura_env.growdirection == \"BOTTOM\" then\n                    yoffset = - (order) * height\n                elseif aura_env.growdirection == \"RIGHT\" then\n                    xoffset = (order) * width\n                elseif aura_env.growdirection == \"LEFT\" then\n                    xoffset = - (order) * width\n                elseif aura_env.growdirection == \"HORIZONTAL\" then\n                    xoffset = (-((order) * width / 2)) + ((order - 1) * width)\n                elseif aura_env.growdirection == \"VERTICAL\" then\n                    xoffset = (-((order) * width / 2)) + ((order - 1) * width)\n                end                    \n                if aura_env.auraCount[v.unit]+1 > aura_env.maxAuraCount then\n                    xoffset = -3000\n                end\n                region:ClearAllPoints()\n                region:SetPoint(\"LEFT\",f,\"RIGHT\",xoffset+aura_env.xOffset,yoffset+aura_env.yOffset)                \n                aura_env.auraCount[v.unit] = aura_env.auraCount[v.unit]+1 \n            else\n                return\n            end            \n        end    \n    end\nend\n\nfunction aura_env.numbering(num)\n    local text = \"\"\n    if num then\n        if num > 9999 then\n            text = format(\"%.1f\", num/10000)..\"만\"\n        else\n            text = num\n        end                        \n    end\n    return text\nend",
					["do_custom"] = true,
