			["triggers"] = {
				{
					["trigger"] = {
						["unevent"] = "auto",
						["type"] = "custom",
						["unit"] = "player",
						["subeventSuffix"] = "_CAST_START",
						["subeventPrefix"] = "SPELL",
						["use_absorbMode"] = true,
						["event"] = "Health",
						["use_unit"] = true,
						["custom_type"] = "stateupdate",
						["custom"] = "function(states,event)\n    for k, v in pairs(states) do\n        aura_env.updateFrames(states)\n        aura_env.Border(states)\n        v.show = false;\n        v.changed = true;\n    end\n    \n    for _, plate in pairs(C_NamePlate.GetNamePlates()) do\n        local unit = plate.namePlateUnitToken\n        if unit and not UnitIsPlayer(unit) then\n            local guid = UnitGUID(unit)\n            local name = UnitName(unit)\n            \n            if aura_env.Absorbs[name] then\n                if WA_GetUnitAura(unit, aura_env.Absorbs[name][2], aura_env.Absorbs[name][1]) then\n                    local b,c,d,e,f,g,_,_,_,id= WA_GetUnitAura(unit, aura_env.Absorbs[name][2], aura_env.Absorbs[name][1])\n                    states[guid..id] = states[guid..id] or {}\n                    local state = states[guid..id]\n                    state.guid = guid;\n                    state.count = aura_env.auraCount[unit];\n                    state.changed = true;\n                    state.show = true;\n                    state.progressType = \"timed\";\n                    state.icon = c;\n                    state.stacks = d;\n                    state.type = e;\n                    state.duration = f;\n                    state.expirationTime = g;\n                    if aura_env.config.absorbamount then\n                        state.abs = select(aura_env.Absorbs[name][3], WA_GetUnitAura(unit, b, aura_env.Absorbs[name][1]));\n                    end\n                    state.unit = unit;\n                    state.autohide = true;\n                    state.resort = true;\n                end\n            end\n            \n            if aura_env.Buffs[name] then\n                for x = 1, 4 do\n                    if WA_GetUnitBuff(unit, aura_env.Buffs[name][x]) then\n                        local b,c,d,e,f,g,_,_,_,id= WA_GetUnitBuff(unit, aura_env.Buffs[name][x])\n                        states[guid..id] = states[guid..id] or {}\n                        local state = states[guid..id]\n                        state.guid = guid;\n                        state.count = aura_env.auraCount[unit];\n                        state.changed = true;\n                        state.show = true;\n                        state.progressType = \"timed\";\n                        state.icon = c;\n                        state.stacks = d;\n                        state.type = e;\n                        state.duration = f;\n                        state.expirationTime = g;\n                        state.unit = unit;\n                        state.autohide = true;\n                        state.resort = true;\n                    end\n                end\n            end\n            \n            if aura_env.DBuffs[name] then\n                if WA_GetUnitBuff(unit, aura_env.DBuffs[name][1]) then\n                    local b,c,d,e,f,g,_,_,_,id= WA_GetUnitBuff(unit, aura_env.DBuffs[name][1])\n                    states[guid..id] = states[guid..id] or {}\n                    local state = states[guid..id]\n                    state.guid = guid;\n                    state.count = aura_env.auraCount[unit];\n                    state.changed = true;\n                    state.show = true;\n                    state.progressType = \"timed\";\n                    state.icon = c;\n                    state.stacks = d;\n                    state.type = \"DBuff\";\n                    state.duration = f;\n                    state.expirationTime = g;\n                    state.unit = unit;\n                    state.autohide = true;\n                    state.resort = true;\n                end\n            end\n            \n            if aura_env.Debuffs[name] then\n                for y = 1, 2 do\n                    if WA_GetUnitDebuff(unit, aura_env.Debuffs[name][y]) then\n                        local b,c,d,e,f,g,_,_,_,id= WA_GetUnitDebuff(unit, aura_env.Debuffs[name][y])\n                        states[guid..id] = states[guid..id] or {}\n                        local state = states[guid..id]\n                        state.guid = guid;\n                        state.count = aura_env.auraCount[unit];\n                        state.changed = true;\n                        state.show = true;\n                        state.progressType = \"timed\";\n                        state.icon = c;\n                        state.stacks = d;\n                        state.type = \"Debuff\";\n                        state.duration = f;\n                        state.expirationTime = g;\n                        state.unit = unit;\n                        state.autohide = true;\n                        state.resort = true;\n                    end\n                end\n            end\n            \n            if aura_env.BDebuffs[name] then\n                for z = 1, 2 do\n                    if WA_GetUnitDebuff(unit, aura_env.BDebuffs[name][z]) then\n                        local b,c,d,_,f,g,_,_,_,id= WA_GetUnitDebuff(unit, aura_env.BDebuffs[name][z])\n                        states[guid..id] = states[guid..id] or {}\n                        local state = states[guid..id]\n                        state.guid = guid;\n                        state.count = aura_env.auraCount[unit];\n                        state.changed = true;\n                        state.show = true;\n                        state.progressType = \"timed\";\n                        state.icon = c;\n                        state.stacks = d;\n                        state.type = e;\n                        state.duration = f;\n                        state.expirationTime = g;\n                        state.unit = unit;\n                        state.autohide = true;\n                        state.resort = true;\n                    end\n                end\n            end\n        end\n    end\n    return true   \nend",
