						["custom"] = "function(states)\n    for k, v in pairs(states) do\n        local region = WeakAuras.GetRegion(aura_env.id, k)\n        region:ClearAllPoints()\n        region:SetPoint(\"LEFT\", v.frame, \"RIGHT\", 0, 0)\n        v.show = false;\n        v.changed = true;\n    end\n    \n    for i = 1, 40 do\n        local unit = \"nameplate\"..i\n        if UnitExists(unit) then\n            local GUID = UnitGUID(unit)\n            states[GUID] = states[GUID] or {}\n            local state = states[GUID]\n            if UnitName(unit) == \"킹\" and UnitDebuff(unit, \"약점\") and select(11, UnitDebuff(unit, \"약점\")) == 229495  then\n                local c,d,_,e,f = select(3, UnitDebuff(unit,\"약점\"))\n                state.frame = C_NamePlate.GetNamePlateForUnit(unit)\n                state.changed = true;\n                state.show = true;\n                state.progressType = \"timed\";\n                state.icon = c;\n                state.duration = e;\n                state.expirationTime = f;\n                state.index = i;\n                state.name = \"\";\n            elseif UnitName(unit) == \"타오르는 검댕돌껍질\" and UnitBuff(unit, \"수정에 부딪힘\") then\n                local c,d,_,e,f = select(3, UnitBuff(unit,\"수정에 부딪힘\"))\n                state.frame = C_NamePlate.GetNamePlateForUnit(unit)\n                state.changed = true;\n                state.show = true;\n                state.progressType = \"timed\";\n                state.icon = c;\n                state.duration = e;\n                state.expirationTime = f;\n                state.index = i;\n                state.name = \"\";\n            elseif UnitName(unit) == \"마나 혼합체\" and UnitBuff(unit, \"용해식 보호막\") then\n                local c,d,_,e,f = select(3, UnitBuff(unit,\"용해식 보호막\"))\n                local absorb = select(17, UnitBuff(unit,\"용해식 보호막\"))\n                state.frame = C_NamePlate.GetNamePlateForUnit(unit)\n                state.changed = true;\n                state.show = true;\n                state.progressType = \"timed\";\n                state.icon = c;\n                state.duration = e;\n                state.expirationTime = f;\n                state.index = i;\n                if absorb > 99999 and absorb < 100000000 then\n                    state.name = format( \"%.0f만\", absorb/10000);\n                else\n                    state.name = \"\";\n                end\n            end\n        end\n    end\n    return true\nend",
