e\n                local region = WeakAuras.GetRegion(aura_env.id, k)\n                if WeakAuras.clones[aura_env.HobulNAT] then\n                    for cloneId,clone in pairs(WeakAuras.clones[aura_env.HobulNAT]) do\n                        if clone.state and clone.state.show and clone.state.guid == v.guid and clone.state.count then\n                            region:ClearAllPoints()\n                            region:SetPoint(\"LEFT\", v.frame, \"RIGHT\", clone.state.count*45.5, 0)\n                            anchored = true;\n                            break\n                        end\n                    end\n                end\n                if anchored == false then\n                    region:ClearAllPoints()\n                    region:SetPoint(\"LEFT\", v.frame, \"RIGHT\", 0, 0)\n                end\n            end\n        end\n    end\n    \n    return true\nend",
