					["custom"] = "-- User Options -- Set options to \"true\" to enable them, \"false\" to disable\n\naura_env.glowEffect = false\n\n-- Do not touch anything below this line\n\naura_env.setVisuals = function(r,g,b)\n    local region = aura_env.region\n    region.timer:SetTextColor(r,g,b,1)\nend\n\naura_env.shortenNumber = function(number)\n    \n    local affixes = {\n        \"\",\n        \"k\",\n        \"m\",\n        \"b\",\n    }\n    \n    local affix = 1\n    local dec = 0\n    local num1 = math.abs(number)\n    while num1 >= 1000 and affix < #affixes do\n        num1 = num1 / 1000\n        affix = affix + 1\n    end\n    if affix > 1 then\n        dec = 1\n        local num2 = num1\n        while num2 >= 10 do\n            num2 = num2 / 10\n            dec = dec - 1\n        end\n    end\n    if number < 0 then\n        num1 = -num1\n    end\n    \n    return string.format(\"%.\"..dec..\"f\"..affixes[affix], num1)\nend\n\n\n\n",
