						["event"] = "Health",
						["subeventPrefix"] = "SPELL",
						["names"] = {
						},
						["custom"] = "function(allstates, event, ...)\n    if event == \"COMBAT_LOG_EVENT_UNFILTERED\" then\n        local _, subEvent, _, sourceGUID, sourceName, _, _, destGUID, destName, _, _, spellID, _,_, auraType = ...\n        if subEvent == \"SPELL_CAST_START\" then\n            if spellID == 318078 then\n                aura_env.slime = aura_env.slime + 1\n                \n                if aura_env.config[\"candytime\"] == aura_env.slime or aura_env.config[\"potiontime\"] == aura_env.slime then\n                    local state = allstates[\"morsel\"]\n                    if state then\n                        state.name = \"물약/생석\"\n                        state.show = true\n                        state.changed = true\n                        state.duration = 10\n                        state.expirationTime = GetTime() + 10\n                        state.autoHide = true\n                    else\n                        allstates[\"morsel\"] = {\n                            name = \"물약/생석\",\n                            show = true,\n                            changed = true,\n                            progressType = \"timed\",\n                            duration = 10,\n                            expirationTime = GetTime() + 10,\n                            autoHide = true,\n                        }\n                    end\n                end\n            end\n        elseif subEvent == \"SPELL_AURA_APPLIED\" and destName == WeakAuras.me and (spellID == 318078 or spellID == 312099) then\n            local text = \"\"\n            \n            if spellID == 318078 then\n                text = \"|T841383:20|t본진밖으로 (\"..aura_env.slime..\"번)\"\n            elseif spellID == 312099 then\n                text = \"|T237328:20|t|cFF00FF00간식먹여|r (\"..aura_env.slime..\"번)\"\n            end\n            \n            local state = allstates[\"morsel\"]\n            if state then\n                state.name = text\n                state.show = true\n                state.changed = true\n                state.autoHide = false\n            else\n                allstates[\"morsel\"] = {\n                    show = true,\n                    changed = true,\n                    name = text,\n                    autoHide = false,\n                }\n            end\n            if spellID == 312099 then\n                allstates[\"morsel\"].carry = true\n            end\n        elseif subEvent == \"SPELL_AURA_APPLIED\" and destName == WeakAuras.me and spellID == 312332 then\n            local text = \"|cFF03FCFC먹였다|r (\"..aura_env.slime..\"번)\"\n            local state = allstates[\"morsel\"]\n            if state then\n                state.name = text\n                state.show = true\n                state.changed = true\n                state.duration = 10\n                state.expirationTime = GetTime() + 10\n                state.autoHide = true\n                state.feed = true\n            else\n                allstates[\"morsel\"] = {\n                    show = true,\n                    changed = true,\n                    name = text,\n                    progressType = \"timed\",\n                    duration = 10,\n                    expirationTime = GetTime() + 10,\n                    autoHide = true,\n                    feed = true,\n                }\n            end\n        elseif subEvent == \"SPELL_AURA_REMOVED\" and destName == WeakAuras.me and spellID == 318078 then\n            local state = allstates[\"morsel\"]\n            if state then\n                state.name = \"\"\n                state.show = true\n                state.changed = true\n                state.duration = 10\n                state.expirationTime = GetTime() + 10\n                state.autoHide = true\n            else\n                allstates[\"morsel\"] = {\n                    show = true,\n                    changed = true,\n                    name = \"\",\n                    progressType = \"timed\",\n                    duration = 10,\n                    expirationTime = GetTime() + 10,\n                    autoHide = true,\n                }\n            end\n            \n            if aura_env.slime%2 == 1 and not WA_GetUnitDebuff(\"player\", 312332) then\n                allstates[\"morsel\"].name = \"간식집어 (\"..aura_env.slime..\"번)\"\n            elseif aura_env.slime%2 == 0 then\n                allstates[\"morsel\"].name = \"|cFFFF0000집지마|r (\"..aura_env.slime..\"번)\"\n            end\n            if aura_env.slime%2 == 1 and WA_GetUnitDebuff(\"player\", 312332) then\n                allstates[\"morsel\"].cantcollect = true\n                SendChatMessage(\"간식 못집음\", \"SAY\")\n                C_Timer.NewTicker(2.5, function() SendChatMessage(\"간식 못집음\", \"SAY\") end, 3)\n            end\n        end\n    end\n    if event == \"ENCOUNTER_START\" then\n        aura_env.slime = 0\n    end\n    return true\nend\n\n\n",
