		["타액(외생기지원)"] = {
			["outline"] = "OUTLINE",
			["text2Point"] = "CENTER",
			["text1FontSize"] = 12,
			["xOffset"] = -542.00009155273,
			["preferToUpdate"] = false,
			["customText"] = "\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
			["shadowYOffset"] = -1,
			["anchorPoint"] = "CENTER",
			["glow"] = false,
			["color"] = {
				1, -- [1]
				1, -- [2]
