						["custom"] = "function(event,...)\n    \n    if event == \"CHAT_MSG_WHISPER\" then\n        msg, _, _, _, _, _, _, _, _, _, _, guid = ...\n        \n        if guid == aura_env.guid then return end\n        if aura_env.stack > 3 then return end\n        if aura_env.vehicle_guid == \"\" then return end\n        \n        local matched_1 = string.find(msg, aura_env.pwd1) \n        local matched_2 = string.find(msg, aura_env.pwd2) \n        local matched_3 = string.find(msg, aura_env.pwd3) \n        local matched_4 = string.find(msg, aura_env.pwd4) \n        local matched_5 = string.find(msg, aura_env.pwd5)        \n        local number = 0\n        local time = GetTime()\n        \n        if matched_1 then number = 1 end        \n        if matched_2 then number = 2 end\n        if matched_3 then number = 3 end        \n        if matched_4 then number = 4 end        \n        if matched_5 then number = 5 end\n        \n        if aura_env.number == number and (time - aura_env.cast_time) < 3 then return end\n        \n        if number > 0 and aura_env.ctext[number] then\n            \n            aura_env.name = aura_env.ctext[number]\n            aura_env.sound_flag = true\n            aura_env.number = number\n            \n        end\n        \n    elseif event == \"UNIT_ENTERED_VEHICLE\" or event == \"UNIT_EXITED_VEHICLE\" then\n        \n        local unit = ...\n        if unit == \"player\" then            \n            aura_env.init()\n            \n            if event == \"UNIT_ENTERED_VEHICLE\" then\n                aura_env.vehicle_guid = UnitGUID(\"vehicle\")\n                \n                if aura_env.stack_text_obj[aura_env.stack] then\n                    \n                    aura_env.name = aura_env.stack_text_obj[aura_env.stack]\n                    \n                end                \n                \n            end\n            \n        end\n        \n    elseif event == \"PLAYER_REGEN_ENABLED\" or event == \"PLAYER_REGEN_DISABLED\"  then \n        \n        aura_env.init()\n        \n    elseif event == \"UNIT_SPELLCAST_SUCCEEDED\" then\n        \n        local unit, _, spellid = ...\n        \n        if (unit == 'vehicle' or unit == 'player') and aura_env.spells[spellid] then\n            \n            --print(unit..\" \"..spellid)\n            \n        end        \n        \n    end\n    \n    \nend",
