						["custom"] = "function(allstates, timestamp, event, hideCaster, sourceGUID, sourceName, sourceFlags, sourceRaidFlags, destGUID, destName, destFlags, destRaidFlags, spellid, spellName, spellSchool, ...)\n    \n    if aura_env.vehicle_guid == sourceGUID or sourceGUID == aura_env.guid then\n        \n        local time = GetTime()\n        \n        if spellid == 288774 then -- 차단\n            \n            SendChatMessage(aura_env.success_text,\"RAID\",\"COMMON\")            \n            aura_env.init()\n            aura_env.name = aura_env.success_text\n            \n        elseif spellid == 286480 and event == \"SPELL_AURA_APPLIED\" then -- 조작 방지 충격            \n            \n            aura_env.init()\n            SendChatMessage(aura_env.fail_text,\"YELL\",\"COMMON\")\n            \n        elseif aura_env.spells[spellid] then\n            \n            aura_env.stack = aura_env.stack + 1\n            local color = aura_env.spells[spellid]\n            if color ~= \"\" then SendChatMessage(aura_env._input..color,\"RAID\",\"COMMON\") end\n            \n            if aura_env.stack_text_obj[aura_env.stack] then\n                \n                aura_env.name = aura_env.stack_text_obj[aura_env.stack]\n                \n            else\n                \n                aura_env.name = aura_env.complete_text\n                \n            end\n            \n            aura_env.cast_time = GetTime()\n            aura_env.sound_flag = false\n            \n        end\n        \n    end    \n    \nend",
