						["custom"] = "function(states)\n    for _, v in pairs(states) do\n        v.show = false;\n        v.changed = true;\n    end\n    \n    for _, plate in pairs(C_NamePlate.GetNamePlates()) do\n        local unit = plate.namePlateUnitToken\n        if unit and UnitIsUnit(unit..\"target\", \"player\") and (UnitChannelInfo(unit) or UnitCastingInfo(unit)) then\n            local cast = UnitCastingInfo(unit)\n            local channel = UnitChannelInfo(unit)\n            if cast and cast == \"영혼의 화살\" and UnitName(unit) == \"자매 솔레나\" then return end\n            local spellInList = (aura_env.Chat[cast] ~= nil or aura_env.Chat[channel] ~= nil)\n            if cast and aura_env.Chat[cast] ~= nil then \n                states[unit] = states[unit] or {}\n                local state = states[unit]\n                if aura_env.Chat[cast] then\n                    state.name = select(1,UnitCastingInfo(unit))..\" 대상\"\n                else\n                    state.name = \"\"\n                end\n                state.icon = select(3,UnitCastingInfo(unit))\n                state.duration = (select(5,UnitCastingInfo(unit))-select(4,UnitCastingInfo(unit)))/1000 \n                state.expirationTime = select(5,UnitCastingInfo(unit))/1000\n                state.progressType = \"timed\"\n                state.changed = true\n                state.show = true\n                state.autohide = true\n                state.resort = true\n            elseif channel and aura_env.Chat[channel] ~= nil then \n                states[unit] = states[unit] or {}\n                local state = states[unit]\n                if aura_env.Chat[channel] then\n                    state.name = select(1,UnitChannelInfo(unit))..\" 대상\"\n                else\n                    state.name = \"\"\n                end\n                state.icon = select(3,UnitChannelInfo(unit))\n                state.duration = (select(5,UnitChannelInfo(unit))-select(4,UnitChannelInfo(unit)))/1000 \n               